import React from "react";
import Entry from "./Entry";
import emojipedia from "../emojipedia";

function App() {
  return (
    <div>
      <h1>
        <span>emojipedia</span>
      </h1>

      <dl className="dictionary">
        {emojipedia.map((emo) => {
          return (
            <Entry emoji={emo.emoji} name={emo.name} meaning={emo.meaning} />
          );
        })}
      </dl>
    </div>
  );
}

export default App;
